title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o11733.m1 -> o11838.m2 -> o11733.m1
  o11838.m2 -> o11733.m1 -> o11838.m2
  o11745.m1 -> o11743.m5 -> o11745.m4 -> o11743.m5
  o11743.m5 -> o11745.m4 -> o11743.m5
  o11745.m4 -> o11743.m5 -> o11745.m4
  o11745.m8 -> o11743.m5 -> o11745.m4 -> o11743.m5
  o11745.m6 -> o11743.m5 -> o11745.m4 -> o11743.m5

features:
  - inheritance
  - overriding
  - method
  - polymorphism

